const initialState = {
  inventoryInfoData: '',
  cadenceData: [],
  csv_names: [],
  simulateDataGraph: [],
};

export default function (state = initialState, action) {
  switch (action.type) {
    case 'GET_INVENTORY_INFO':
      return {
        ...state,
        inventoryInfoData: action.payload,
      };
    case 'GET_SIMULATE_GRAPH_DATA':
      return {
        ...state,
        simulateDataGraph: action.payload,
      };
    case 'GET_CADENCE_DATA':
      return {
        ...state,
        cadenceData: action.payload,
        csv_names: action.csv_names,
        skus: action.skus,
        savedData: action.savedData,
      };
    default:
      return {
        ...state,
      };
  }
}
